CREATE TABLE `vanguard`.`cards_all`
(
   `cards_id` INTEGER NOT NULL AUTO_INCREMENT,
   `Name` VARCHAR(255) NULL,
   `Set/Number` VARCHAR(100) NULL,
   `ImageFile` VARCHAR(100) NULL,
   `Clan` VARCHAR(100) NULL,
   `Grade/Skill` VARCHAR(100) NULL,
   `Type` VARCHAR(100) NULL,
   PRIMARY KEY (`cards_id`)
);
